<p>HashMap实现了Map接口，Map中的数据是以(Key,Value)的形式存储的，在查找的时候，能够通过哈希函数将Key映射到哈希表中的一个索引位置，从而实现快速访问。Key不能重复，但是Value可以重复。</p>
<p>HashMap的<strong>键和值都可以为null</strong>，如果键为null，则映射到哈希表的第一个元素。</p>
<p>HashMap有一个初始容量和负载因子，初始容量是哈希表的初始大小，默认是16，负载因子是哈希表在扩容之前，存储的键值对数量和哈希表大小的比例，默认是0.75。</p>
